    "\n  query ExpenseFormSchema(\n    $collectiveSlug: String\n    $hasCollectiveSlug: Boolean!\n    $payeeSlug: String\n    $hasPayeeSlug: Boolean!\n    $submitterSlug: String\n    $hasSubmitterSlug: Boolean!\n    $hasExpenseId: Boolean!\n    $expenseId: Int\n    $expenseKey: String\n  ) {\n    account(slug: $collectiveSlug) @include(if: $hasCollectiveSlug) {\n      ...ExpenseFormAccountFields\n    }\n\n    payee: account(slug: $payeeSlug) @include(if: $hasPayeeSlug) {\n      ...ExpenseFormPayeeFields\n    }\n\n    loggedInAccount {\n      id\n      ...LoggedInAccountExpensePayoutFields\n    }\n\n    submitter: account(slug: $submitterSlug) @include(if: $hasSubmitterSlug) {\n      ...ExpenseFormSubmitterFields\n    }\n\n    recentlySubmittedExpenses: expenses(\n      createdByAccount: { slug: $submitterSlug }\n      limit: 10\n      types: [INVOICE, RECEIPT]\n      orderBy: { field: CREATED_AT, direction: DESC }\n    ) @include(if: $hasSubmitterSlug) {\n      nodes {\n        account {\n          id\n          name\n          type\n          slug\n          imageUrl\n\n          childrenAccounts(isActive: true) {\n            nodes {\n              id\n              name\n              type\n              slug\n              imageUrl\n            }\n          }\n\n          ... on AccountWithParent {\n            parent {\n              id\n              name\n              type\n              slug\n              imageUrl\n\n              childrenAccounts(isActive: true) {\n                nodes {\n                  id\n                  name\n                  type\n                  slug\n                  imageUrl\n                }\n              }\n            }\n          }\n        }\n        payee {\n          id\n          name\n          type\n          slug\n          imageUrl\n        }\n        payoutMethod {\n          id\n        }\n      }\n    }\n\n    expense(expense: { legacyId: $expenseId }, draftKey: $expenseKey) @include(if: $hasExpenseId) {\n      id\n      legacyId\n      description\n      longDescription\n      amountV2 {\n        valueInCents\n        currency\n      }\n      taxes {\n        id\n        type\n        rate\n        idNumber\n      }\n      requiredLegalDocuments\n      accountingCategory {\n        id\n      }\n      currency\n      type\n      status\n      account {\n        ...ExpenseFormAccountFields\n      }\n      payee {\n        ...ExpenseFormPayeeFields\n      }\n      payoutMethod {\n        id\n      }\n      attachedFiles {\n        id\n        url\n        info {\n          name\n          type\n          size\n        }\n      }\n      items {\n        id\n        description\n        url\n        file {\n          name\n          type\n          size\n        }\n        amount: amountV2 {\n          currency\n          valueInCents\n          exchangeRate {\n            value\n            source\n            fromCurrency\n            toCurrency\n            date\n          }\n        }\n        createdAt\n        incurredAt\n      }\n      privateMessage\n      invoiceInfo\n      tags\n      permissions {\n        id\n        canEdit\n        canEditAccountingCategory\n        canEditTags\n      }\n      draft\n      submitter: createdByAccount {\n        ...ExpenseFormSubmitterFields\n      }\n    }\n  }\n\n  \n\n  fragment ExpenseFormSchemaFeatureFields on Account {\n    features {\n      id\n      MULTI_CURRENCY_EXPENSES\n      PAYPAL_PAYOUTS\n    }\n  }\n\n  fragment ExpenseFormSchemaPolicyFields on Account {\n    policies {\n      EXPENSE_CATEGORIZATION {\n        requiredForExpenseSubmitters\n        requiredForCollectiveAdmins\n      }\n    }\n  }\n\n  fragment ExpenseFormSchemaHostFields on Host {\n    id\n    legacyId\n    name\n    legalName\n    slug\n    type\n    currency\n    settings\n\n    location {\n      id\n      address\n      country\n    }\n    transferwise {\n      id\n      availableCurrencies\n    }\n\n    supportedPayoutMethods\n    isTrustedHost\n\n    expensesTags {\n      id\n      tag\n    }\n\n    ...ExpenseFormSchemaPolicyFields\n    ...ExpenseFormSchemaFeatureFields\n\n    expensePolicy\n    accountingCategories(kind: EXPENSE) {\n      nodes {\n        id\n        name\n        kind\n        expensesTypes\n        friendlyName\n        code\n        instructions\n        appliesTo\n      }\n    }\n  }\n\n  fragment ExpenseFormAccountFields on Account {\n    id\n    name\n    slug\n    type\n    currency\n    settings\n    supportedExpenseTypes\n\n    expensePolicy\n\n    stats {\n      balance {\n        valueInCents\n        currency\n      }\n    }\n\n    ...ExpenseFormSchemaFeatureFields\n    ...ExpenseFormSchemaPolicyFields\n\n    ... on AccountWithHost {\n      host {\n        ...ExpenseFormSchemaHostFields\n      }\n    }\n    ... on Organization {\n      host {\n        ...ExpenseFormSchemaHostFields\n      }\n    }\n  }\n\n  fragment ExpenseFormSubmitterFields on Account {\n    id\n    slug\n    name\n    imageUrl\n  }\n\n  fragment ExpenseFormPayeeFields on Account {\n    id\n    slug\n    name\n    type\n    isAdmin\n    payoutMethods {\n      id\n      type\n      name\n      data\n      isSaved\n    }\n\n    location {\n      address\n      country\n    }\n\n    ... on AccountWithHost {\n      host {\n        ...ExpenseFormSchemaHostFields\n      }\n    }\n    ... on Organization {\n      host {\n        ...ExpenseFormSchemaHostFields\n      }\n    }\n    ... on AccountWithParent {\n      parent {\n        id\n        slug\n      }\n    }\n  }\n": types.ExpenseFormSchemaDocument,
